import React, {useState} from "react";
import "./Form.css";
export default function SignUpForm() {
    const [signedUp, setSignedUp] = useState(true);

    if (!signedUp) {
        return (
            <div className="form-container">
                 <div className="form-box">
                     <form id="name-form">
                         <label for="name">Name:   </label>
                         <input type="text" id="name" name="name" required/>
                     </form>
                     <form id="tiecolor-form">
                         <label for="text">Tie Color:   </label>
                         <select id="tiecolor" name="tiecolor" required>
                             <option value="red">Blue</option>
                             <option value="blue">Green</option>
                             <option value="green">Red</option>
                             <option value="yellow">Yellow</option>
                 </select>
                     </form>

                     <button>Submit</button>
                 </div>
            </div> 
         );
    }
    else {
        return (
            <div>
                <p>Thanks for Signing Up, Our first meeting will be on Septmber 30th!</p>
            </div>
        );
    }

}
